import React from 'react';
import DataTable from 'react-data-table-component';
import { Link } from 'react-router-dom';

class ProjectData extends React.Component {
    
    render() {
        let userDetails = this.props.location.userDetails;
        const columns = [
            {
                name: 'ID',
                selector: 'id',
                sortable: true,
            },
            {
                name: 'Name',
                selector: 'name',
                sortable: true,
            },
            {
                name: 'Actions',
                selector: 'actions',
            }
          ];
        const data = [
            {
                id: 1,
                name: 'ClientUse',
                actions: <Link to='/task'>Craete Task</Link>
            },
            {
                id: 2,
                name: 'DeveloperUse',
                actions: <Link to='/task'>Craete Task</Link>
            },
            {
                id: 3,
                name: 'AdminUse',
                actions: <Link to='/task'>Craete Task</Link>
            }
        ]
        return (
            <div className="col-md-6 col-md-offset-3">
                <h2>{userDetails && userDetails.name}</h2>
                <div className="col-md-6">
                    <h2>Project List</h2>
                    <DataTable 
                    columns={columns}
                    data={data}
                    />
                </div>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        userDetails: state.Reducer.data
    }
}

export default ProjectData;
